		"text": "«الميل للتمركز وتوسيع السلطات، واستغلالها للسيطرة على حياة الأفراد، احتمال مقلق في مرحلة ما بعد «كورونا». ربما لن تكون ممكنة بكاملها، لأنَّها ليست واقعية تماماً. لكن على الإنسان أن يحذر من الميل الغريزي عند الأقوياء لاستعباده، فهذا سيكون أسوأ قدر ينتظره.» https://t.co/NifzpnwNO6"
